import React from "react";
import styled from "styled-components";

export const Cell = (props) => {
  return (
    <StyledDiv>
      {props.value != -1 ? <div>{props.value}</div> : <div></div>}
    </StyledDiv>
  );
};

Cell.defaultProps = {
  value: -1,
  note1: 0,
  note2: 0,
  note3: 0,
  note4: 0,
  note5: 0,
  note6: 0,
  note7: 0,
  note8: 0,
  note9: 0,
};

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  height: 100%;
  width: 100%;
  overflow: hidden;
  border: 1px solid black;
  color: #61dbfb;
`;
